import React from "react";
import exceededModal from "../exceededModal.module.scss";

export const ModalRowChangeable = ({
  dataUpdate,
  limit,
  usage,
  queryData,
  handleChange,
}) => {
  return (
    <div className={exceededModal.limits}>
      <div>
        <span className={exceededModal.limitsitems}>{queryData} :</span>
      </div>
      <div>
        <b className={limit <= usage ? "colorRose" : "colorBlack"}>{usage}</b>{" "}
        out of
      </div>
      <div>
        <input
          value={limit}
          onChange={(e) => {
            handleChange(queryData, e.target.value, usage);
            dataUpdate(queryData, e);
          }}
        />
      </div>
    </div>
  );
};
